import React from 'react'
import "./Tree.css";


function Tree() {
  return (
    <div className='tree-container'>
        <div className='tree-sub-container'>
            <div className='tree-upper-container'></div>
            <div className='mid-shape-with-circle'><div className='mid-circle'></div></div>    
        </div>
    </div>
  )
}

export default Tree
